  false,\n\t\"url\": null,\n\t\"notes\": \"In 1993, state-mandated screening for childhood
  lead poisoning in children 6 years of age and younger began. Physicians and other
  health care providers have conducted 2.4 million lead tests and reported about 270,000
  children with elevated lead levels. The numbers of elevated and normal test results
  are used to identify areas where effort is needed to combat lead poisoning.\",\n\t\"license_title\":
